import React from "react";
import ReactDOM from "react-dom";
// import './index.css';
import App from "./App";
import { AuthProvider, RequireAuth } from "./context/AuthProvider";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Login from "./Login/Login";
import Patient_Dashboard from "./Patient/Patient_Dashboard";
import Doctor_Dashboard from "./Doctor/Doctor_Dashboard";
import {createRoot} from 'react-dom/client';

const root = ReactDOM.createRoot(document.getElementById("root"));

root.render(
  <React.StrictMode>
    <BrowserRouter>
      <Routes>
        <Route index element={<App />} />
        <Route path="login" element={<Login />} />
        {/* <Route path="patient" element={<Patient_Dashboard />} /> */}
        <Route
          path="patient"
          element={
            <RequireAuth>
              <Patient_Dashboard />
            </RequireAuth>
          }
        />
        <Route path="doctor" element={<Doctor_Dashboard />} />
      </Routes>
    </BrowserRouter>
  </React.StrictMode>
);
